  return (
    <>
      <header>
        <h1>
          ToDo App
        </h1>
        <nav className="menu">
          <ul>
            <li>To Do</li>
            <li>Done</li>
            <li>Account</li>
          </ul>
        </nav>
        <img src="/images/menu-icon.svg" alt="menu-icon" />
      </header>
      <style jsx>
        {`
        header {
          width: 100%;
          height: 60px;
          background: #64D7EB;
          color: white;
          display: flex;
          justify-content: space-evenly;
          align-items: center;
          box-shadow: 7px 0px 10px rgba(0, 0, 0, 0.1);
        }

        h1 {
          font-size: 36px;
        }
        ul {
          display: none;
        }
        li {
          margin-right: 10px;
          list-style: none;
        }
        @media screen and (min-width: 425px){
          header {

          }

          img {
            display: none
          }
          ul {
            display: flex;
          }
        } 

      `}
      </style>
    </>
  );
};

export default Header;
